import React from 'react'
 class MyDialog extends React.Component {
        render() {
          const container = {
            position: 'absolute',
            top: '30px',
            left: '50%',
            marginLeft: '-150px',
            width: '300px',
            height: '200px',
            border: '1px solid blue',
            zIndex: 9999
          }
          const title = {
            height: '35px',
            backgroundColor: 'lightblue'
          }
          const layer = {
            position: 'absolute',
            top: 0,
            left: 0,
            right: 0,
            bottom: 0,
            backgroundColor: 'rgba(0,0,0,.5)',
            zIndex: 1
          }
          return (
            <div>
              <div style={container}>
                <div style={title}>{this.props.title}</div>
                <div>{this.props.children}</div>
              </div>
              <div style={layer}></div>
            </div>
          );
        }
      }
      
      const element = (
        <MyDialog title='your order'>
          <div></div>
        </MyDialog>
      );
export default Msgbox;
